import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div>
        <p>Contact us: email@prestigeproperties.com</p>
        <p>Follow us: 
          <a href="#facebook">Facebook</a> | 
          <a href="#twitter">Twitter</a> | 
          <a href="#instagram">Instagram</a>
        </p>
      </div>
    </footer>
  );
}

export default Footer;
